import React, { useRef, useImperativeHandle } from "react";
import Video from "./videos/video-1.mp4";

function video() {
  const videoRef = useRef();
  return (
    <div>
      <Video width={300} src={Video} ref={videoRef} />
    </div>
  );
}
export default video;
